import React from "react";
import { useNavigate } from "react-router-dom";

const HomePage = () => {
  const navigate = useNavigate();
  
  return (
    <div>
      <h1>Welcome to the Grid App</h1>
      <button onClick={() => navigate("/grid")}>Start</button>
    </div>
  );
};

export default HomePage;
